// src/pages/admin/Dashboard.jsx
import { useEffect, useState, useCallback } from "react";
import { getAdminDashboard, deleteEntity } from "../../services/adminApi";
import { useConfirm } from "../../hooks/useConfirm";
import CrudModal from "../../components/admin/CrudModal";
import DashboardTable from "../../components/admin/DashboardTable";
import "../../styles/dashboard.css";
import Navbar from "../../Home/Navbar";

const EMPTY = {
  users: [],
  categories: [],
  products: [],
  customers: [],
  orders: [],
  employees: [],
  sales: [],
  reservations: [],
};

const Dashboard = () => {
  const [loading, setLoading] = useState(true);
  const [stats, setStats] = useState({});
  const [latest, setLatest] = useState(EMPTY);

  const [modalOpen, setModalOpen] = useState(false);
  const [currentTable, setCurrentTable] = useState("");
  const [formData, setFormData] = useState({});
  const [loadingForm, setLoadingForm] = useState(false);

  const { confirm, ConfirmModal } = useConfirm();

  // ================= FETCH =================
  const fetchDashboard = useCallback(async () => {
    try {
      setLoading(true);
      const res = await getAdminDashboard();
      const data = res.data || {};

      setStats(data.statistics || {});
      setLatest({
        users: data.latest?.users || [],
        categories: data.latest?.categories || [],
        products: data.latest?.products || [],
        customers: data.latest?.customers || [],
        orders: data.latest?.orders || [],
        employees: data.latest?.employees || [],
        sales: data.latest?.sales || [],
        reservations: data.latest?.reservations || [],
      });
    } catch (e) {
      console.error(e);
      setLatest(EMPTY);
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchDashboard();
  }, [fetchDashboard]);

  // ================= CRUD =================
  const handleAdd = (table) => {
    setCurrentTable(table);
    setFormData({});
    setModalOpen(true);
  };

  const handleEdit = (table, item) => {
    setCurrentTable(table);
    setFormData(item);
    setModalOpen(true);
  };

  const handleDelete = async (table, id) => {
    await confirm(async () => {
      await deleteEntity(table, id);
      fetchDashboard();
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoadingForm(true);

    try {
      if (formData.id || formData._id) {
        await updateEntity(currentTable, formData.id || formData._id, formData);
      } else {
        await createEntity(currentTable, formData);
      }

      setModalOpen(false);
      fetchDashboard();
    } catch (err) {
      console.error(err);
    } finally {
      setLoadingForm(false);
    }
  };

  if (loading) return <h2 className="loading">Loading Dashboard...</h2>;

  return (
    <div className="dashboard">
      <h1>Admin Dashboard</h1>

      {/* ===== STATS ===== */}
      <div className="stats">
        {Object.entries(stats).map(([k, v]) => (
          <div key={k} className="stat-card">
            <h3>{k}</h3>
            <p>{v}</p>
          </div>
        ))}
      </div>

      {/* ===== TABLES ===== */}
      {Object.entries(latest).map(([table, rows]) => (
        <DashboardTable
          key={table}
          title={table}
          rows={rows}
          onAdd={() => handleAdd(table)}
          onEdit={(item) => handleEdit(table, item)}
          onDelete={(id) => handleDelete(table, id)}
        />
      ))}

      <ConfirmModal />

      <CrudModal
        open={modalOpen}
        title={`${formData.id ? "Edit" : "Add"} ${currentTable}`}
        formData={formData}
        onChange={(e) =>
          setFormData({ ...formData, [e.target.name]: e.target.value })
        }
        onSubmit={handleSubmit}
        onClose={() => setModalOpen(false)}
      />
    </div>
  );
};

export default Dashboard;
